  const [apiRes, setApiRes] = useState("");

  async function getResponse(){
    await fetch("https://petstore.swagger.io/v2/swagger.json")
   .then(response=>{return response.json()})
   .then((responseData)=>{
    setApiRes(responseData);
   })
 }
 useEffect(()=>{ getResponse();},[])


